import React from 'react';
import Card from './Card';

const CardList = ({robots}) => {

	return (
		<div>
			{
			robots.map((user, i) => {
				return (
				<Card 
					key={robots[i].id}
					username={robots[i].username}
					name={robots[i].name}
					email={robots[i].email}
					/>
				);
			})
			}
		</div>
		);
}
export default CardList;
